import React from "react";
import styled from "styled-components";
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
const StyledDiv = styled.div`
  display: flex;
  width: 80%;
  align-content: flex-start;
  justify-content: space-around;
  float: right;
  height: 1500px;
  right: 0;
  flex-wrap: wrap;
  margin-top: 35px;
`;
////////////////////////////////////////////////////////////////
const ProductDiv = styled.div`
  display: flex;
  flex-direction: column;
  background-color: white;
  width: 250px;
  height: 200px;
  border: 0.1px solid black;
  margin-top: 10px;
  img {
    width: 60%;
    height: 50%;
    left: 0;
    right: 0;
    margin: 15px auto;
  }
`;
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
const NextPage = styled.div`
  display: flex;
  width: 300px;
  height: 30px;
  border: 1px solid black;
  float: right;
`;
const NextPageIcons = styled.div`
  width: 25px;
  height: 25px;
  border: 1px solid black;
  font-size: 5px;
`;
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
function Products() {
  return (
    <div>
      <StyledDiv>
        <ProductDiv>
          <img
            src={
              "https://images-eu.ssl-images-amazon.com/images/I/61Sxu3XttGL.__AC_SY300_SX300_QL70_ML2_.jpg"
            }
            alt=""
          />
        </ProductDiv>
        <ProductDiv>
          <img
            src={
              "https://images-eu.ssl-images-amazon.com/images/I/61q3C8FoqUL.__AC_SY445_SX342_QL70_ML2_.jpg"
            }
            alt=""
          />
        </ProductDiv>
        <ProductDiv>
          <img src="" alt="" />
        </ProductDiv>
        <ProductDiv>
          <img src="" alt="" />
        </ProductDiv>
        <ProductDiv />
        <ProductDiv />
        <ProductDiv />
        <ProductDiv />
        <ProductDiv />
        <ProductDiv />
        <ProductDiv />
        <ProductDiv />
        <ProductDiv />
      </StyledDiv>
      <NextPage>
        <NextPageIcons><button>1</button></NextPageIcons>
        <NextPageIcons><button>2</button></NextPageIcons>
        <NextPageIcons><button>3</button></NextPageIcons>
        <NextPageIcons>...</NextPageIcons>
        <NextPageIcons><button>5</button></NextPageIcons>
      </NextPage>
    </div>
  );
}

export default Products;
